import React, { Component } from 'react';

class Projects extends Component {
  render() {

    return(
    <div className="animated fadeInLeft">
      all the stuff for projects
    </div>
    )
  }
}

class Buttons extends Component {
  render() {
    return(
      <button>
        content
      </button>
    )
  }
}



export default Projects;
